on path','urn:mace:dir:attribute-def:eduPersonOrgDN','Shib-EP-OrgDN','orgDN','Organization path: The distinguished name (DN) of the directory entry representing the organization with which the person is associated','Federation','optional'),(10,'1.3.6.1.4.1.5923.1.1.1.4','eduPersonOrgUnitDN','Organizational unit path','urn:mace:dir:attribute-def:eduPersonOrgUnitDN','Shib-EP-OrgUnitDN','orgUnitDN','Organization unit path: The distinguished name (DN) of the directory entries representing the persons Organizational Unit(s)','Federation','optional'),(11,'1.3.6.1.4.1.5923.1.1.1.7','eduPersonEntitlement','Entitlement','urn:mace:dir:attribute-def:eduPersonEntitlement','Shib-EP-Entitlement','entitlement','Member of: URI (either URL or URN) that indicates a set of rights to specific resources based on an agreement ac\r\nross the releavant community','Federation','mandatory'),(12,'2.5.4.4','surname','Surname','urn:mace:dir:attribute-def:sn','Shib-Person-surname','surname','Surname or family name','Federation','recommended'),(13,'2.5.4.42','givenName','Given name','urn:mace:dir:attribute-def:givenName','Shib-InetOrgPerson-givenName','givenName','Given name of a person','Federation','recommended'),(14,'2.16.840.1.113730.3.1.3','employeeNumber','Employee number','urn:mace:dir:attribute-def:employeeNumber','Shib-InetOrgPerson-employeeNumber','employeeNumber','Identifies an employee within an organization','Federation','optional'),(15,'2.5.4.11','ou','Organizational Unit','urn:mace:dir:attribute-def:ou','Shib-Person-ou','ou','OrganizationalUnit currently used for faculty membership of staff','local','optional'),(16,'1.3.6.1.4.1.5923.1.1.1.6','eduPersonPrincipalName','Principal Name','urn:mace:dir:attribute-def:eduPersonPrincipalName','Shib-EP-PrincipalName','principalName','eduPerson per Internet2 and EDUCAUSE see &lt;http://www.nmi-edit.org/eduPerson/draft-internet2-mace(...)','Federation','recommended'),(17,'1.3.6.1.4.1.5923.1.1.1.11','eduPersonAssurance','Assurance Level','urn:mace:dir:attribute-def:assurance','Shib-EP-Assurance','eduPersonAssurance','This attribute represents identity assurance profiles (IAPs), which are the set of standards that are met by an identity assertion, based on the Identity Providers identity management processes, type of auth credential used, binding strength, etc.','Federation','mandatory'),(18,'2.16.840.1.113730.3.1.39','preferredLanguage','Preferred Language','urn:mace:dir:attribute-def:preferredLanguage','Shib-InetOrgPerson-preferredLanguage','preferredLanguage','Preferred written or spoken language for a person','Federation','recommended'),(47,'2.16.840.1.113730.3.1.241','displayName','Display Name','urn:mace:dir:attribute-def:displayname','Shib-InetOrgPerson-displayName','displayName','Preferred name of a person to be used when displaying entries. This attribute should not be used in transactions where it is desirable to maintain user anonymity.','Federation','mandatory'),(48,'2.16.840.1.113730.3.1.40','userSMIMECertificate','User S/MIME Certificate','urn:mace:dir:attribute-def:userSMIMECertificate','Shib-InetOrgPerson-userSMIMECertificate','userSMIMECertificate','An X.509 certificate specifically for use in S/MIME applications (see RFCs\r\n2632, 2633 and 2634).','Federation','recommended'),(49,'1.3.6.1.4.1.5923.1.1.1.9','eduPersonScopedAffiliation','eduPersonScopedAffiliation','urn:mace:dir:attribute-def:eduPersonScopedAffiliation','Shib-Scoped-Affiliation','eduPersonScopedAffiliation','This attribute enables an organisation to assert its relationship with the\r\nuser.','Federation','mandatory'),(50,'2.5.4.3','cn','cn','urn:mace:dir:attribute-def:cn','Shib-Person-cn','cn','An individuals common name, typically their full name. This attribute should not be used in transactions where it is desirable to maintain user anonymity.','Federation','mandatory'),(51,'1.3.6.1.4.1.25178.1.2.2','schacGender','Gender','urn:oid:1.3.6.1.4.1.25178.1.2.2','Shib-schac-Gender','schacGender','The state of being male or female. The gender attribute specifies the legal gender of the subject it is associated with.','Federation','recommended'),(52,'2.5.4.10','topLevelOrg','Top-level Organisation','urn:mace:dir:attribute-def:TopLevelOrg','Shib-inetOrgPerson-TopLevelOrg','topLevelOrg','Standard name of the top-level organization (institution) with which this person is associated.','Federation','mandatory'),(53,'1.3.6.1.4.1.25178.1.2.8','schacPersonalTitle','Personal Title','urn:oid:1.3.6.1.4.1.25178.1.2.8','Shib-schac-PersonalTitle','schacPersonalTitle','The Personal Title attribute type specifies a personal title or salutation for a person. Examples of personal titles are Ms, Dr, Prof, Rev and Sr','Federation','recommended'),(54,'1.3.6.1.4.1.25178.1.2.12','schacUserPresenceID','User Presence ID','urn:oid:1.3.6.1.4.1.25178.1.2.12','Shib-schac-UserPresenceID','schacUserPresenceID','To store a set of values related to network presence protocols.','Federation','recommended'),(60,'2.5.4.36','userCertificate','User Certificate','urn:mace:dir:attribute-def:userCertificate','Shib-inetOrgPerson-userCertificate','userCertificate','A user\'s X.509 certificate','Federation','recommended'),(55,'1.3.6.1.4.1.27856.1.2.5','auEduPersonSharedToken','Shared Token','urn:oid:1.3.6.1.4.1.27856.1.2.5','Shib-AEP-SharedToken','auEduPersonSharedToken','A unique identifier enabling federation spanning services such as Grid and Repositories','Federation','mandatory'),(56,'1.3.6.1.4.1.27856.1.2.1','auEduPersonAffiliation','AU Affiliation','urn:oid:1.3.6.1.4.1.27856.1.2.1','Shib-AEP-Affiliation','auEduPersonAffiliation','Specifies a person\'s relationship to the institution in broad categories but\r\nwith a finer-grained set of permissible values than eduPersonAffiliation.','Federation','recommended'),(57,'1.3.6.1.4.1.27856.1.2.2','auEduPersonLegalName','Legal Name','urn:oid:1.3.6.1.4.1.27856.1.2.2','Shib-AEP-LegalName','auEduPersonLegalName','The users legal name, as per their passport, birth certificate, or other legal\r\ndocument','Federation','recommended'),(58,'1.3.6.1.4.1.5923.1.1.1.5','eduPersonPrimaryAffiliation','Primary Affiliation','urn:mace:dir:attribute-def:eduPersonPrimaryAffiliation','Shib-EP-PrimaryAffiliation','eduPersonPrimaryAffiliation','Specifies the person\'s PRIMARY relationship to the institution in broad\r\ncategories such as student, faculty, staff, alum, etc.','Federation','recommended'),(59,'1.3.6.1.4.1.25178.1.2.14','schacPersonalUniqueCode','Personal Unique Code','urn:oid:1.3.6.1.4.1.25178.1.2.14','Shib-schac-PersonalUniqueCode','schacPersonalUniqueCode','Specifies a unique code for the subject it is associated with. Its value\r\ndoes not necessarily correspond to any identifier outside the scope of the\r\ndirectories using this schema. This might be Student number, Employee\r\nnumber, ...','Federation','recommended'),(61,'1.3.6.1.4.1.25178.1.2.9','homeOrganization','Home Organization','urn:oid:1.3.6.1.4.1.25178.1.2.9','Shib-HomeOrganization','homeOrganization','Users Home Organization','Federation','mandatory'),(62,'1.3.6.1.4.1.25178.1.2.10','homeOrganizationType','Home Organization Type','urn:oid:1.3.6.1.4.1.25178.1.2.10','Shib-HomeOrganizationType','homeOrganizationType','Type of Organization the user belongs too','Federation','mandatory'),(64,'2.5.4.7','Locality','Locality','urn:mace:dir:attribute-def:locality','Shib-Locality','Locality','Identifies the county, city, or other geographical area in which the entry is located or with which it is in some other way associated','Federation','recommended'),(67,'1.3.6.1.4.1.6137.1.100','ucDeptCode','University of Canterbury Department Code','urn:mace:canterbury.ac.nz:attribute:ucdeptcode','Shib-Custom-UC-DeptCode','ucDeptCode','This attribute used by University of Canterbury Confluence Wiki is used for managing group membership.','local','optional'),(70,'1.3.6.1.4.1.6137.1.103','ucCourse','University of Canterbury Course Code','urn:mace:canterbury.ac.nz:attribute:uccourse','Shib-Custom-UC-Course','ucCours